import ReactStars from "react-rating-stars-component";

function MovieFiletr({filtertext,filterrate}) {
    return (
        <div>
            <input/>
           <ReactStars
    count={5}
    // onChange={ratingChanged}
    size={24}
    activeColor="#ffd700"
  /> 
        </div>
    )
}

export default MovieFiletr
